import React from "react";
import Toolkit from "../../assets/projects/toolkit.jpg";

// Needs to create a whole new model with each project for?
function Projects() {
  function openFile(e) {
    e.preventDefault();
    console.log("clicked");
  }

  const pictures = [];

  return (
    <section className="my-2 card container" style={{ width: "18rem"}}>
      <img
        className="card-img-top"
        src={Toolkit}
        alt="This is the foto"
      ></img>
      <a
        onClick={{ openFile }}
        className="button btn btn-primary"
        href="https://lrivales.github.io/app-toolkit/"
        target="_blank"
        rel="noreferrer noopener"
      >
        Open
      </a>
    </section>
  );
}

export default Projects;
